import React from 'react';
import {Text, StyleSheet,View} from 'react-native';



const Screen = () => {
    return (
        <View>
            <Text style={style.textStyle}> Hello Abbassi ♥ ♦ ♣ ♠ </Text>
        </View>
    );
}
const style = StyleSheet.create({
    textStyle: {
        fontSize: 40,
        color: 'red'
    }
});
export default Screen;
